const Button = ({name, color}) => {
    return (
        <TouchableOpacity onPress={this._onPressButton}> 
      <ImageBackground style={styles.button} source={require('./myButton.png')} >
      <Text>Press me</Text>
      </ImageBackground>
    </TouchableOpacity>
    )
}

Button.defaultProps = {
    name: 'click',
    color: 'green'
}

export default Button
